create table customers (
	customer_id INT PRIMARY KEY,
	company_name VARCHAR(50),
	signup_date DATE,
	plan_type VARCHAR(12),
	Industry VARCHAR(18),
	account_owner VARCHAR(50),
	status VARCHAR(7)
);


-- Add MRR column to customers table
ALTER TABLE customers ADD COLUMN mrr DECIMAL(10,2);

-- Populate MRR based on plan type with variance
UPDATE customers SET mrr = 49 + (RANDOM() * 30) WHERE plan_type = 'Starter';
UPDATE customers SET mrr = 199 + (RANDOM() * 100) WHERE plan_type = 'Professional';
UPDATE customers SET mrr = 999 + (RANDOM() * 500) WHERE plan_type = 'Enterprise';